const Icon_data = [
    {
      id: 1,
      title: "Crypto Currancy",
      image: require("./img/Crypto.png")
    },
    {
      id: 2,
      title: "Travling-App",
      image: require("./img/Travling.png")
    },
    {
      id: 3,
      title: "Hijab Store",
      image: require("./img/Hijab_store.png")
    },
    {
      id: 4,
      title: "Movie App",
      description: "Designed marketing materials including brochures, flyers, and banners for a promotional campaign.",
      image: require("./img/Movie.png")
    },
    {
      id: 5,
      title: "Expance tracker",
      description: "Conducted data analysis on customer feedback surveys to identify trends and provide actionable insights.",
      image: require("./img/Expences_Tracker.png")
    },
    {
      id: 6,
      title: "Resturant",
      description: "Developed and executed a social media marketing campaign across multiple platforms to increase brand visibility and engagement.",
      image: require("./img/Resturant.png")
    }
  ];
  
  export default Icon_data;
